import logo from './logo.svg';
import './App.css';

const Navbar = (props) => {
  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
        <div class="container-fluid">
          <a class="navbar-brand align-content-center">
            <img src="logo_v1.png" style={{width: '1em'}} /> 
            Personal Finance
          </a>
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav me-auto mb-2 mb-lg-0">
              <li class="nav-item">
                <a class="nav-link active" aria-current="page" href="index.html">Tools</a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="contact.html">Contact</a>
              </li>
            </ul>
            <form class="d-flex" role="search">
              <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
              <button class="btn btn-outline-success" type="submit">Search</button>
            </form>
          </div>
        </div>
      </nav>
    </>
  )
}

const Footer = () => {
  return (
    <div class="container">
      <footer class="d-flex flex-wrap justify-content-between align-items-center py-3 my-4 border-top">
        <p class="col-md-4 mb-0 text-body-secondary">&copy; 2024 Tech Tana. All rights reserved.</p>
        <ul class="nav col-md-4 justify-content-end">
          <li class="nav-item"><a href="privacy_policy.html" class="nav-link px-2 text-body-secondary">Privacy Policy</a></li>
          <li class="nav-item"><a href="terms_of_use.html" class="nav-link px-2 text-body-secondary">Terms of Use</a></li>
        </ul>
      </footer>
    </div>
  )
}

const Member = (props) => {
  return (
    <>
      <td>
        <tr>{props.name}</tr>
        <tr>{props.lastName}</tr>
        <tr>{props.age}</tr>
      </td>
    </>
  )
}

const App = () => {
  const name = 'Ryan';
  const isNameShowing = true;
  const isNameAvail = true;

  return (
    <>
      <Navbar currentPage="" />
      <div className="App container my-3">
        <Member name='Tim' lastName='Maden' age={14} />
        <Member name='Tim' lastName='Maden' age={14} />
        <Member name='Tim' lastName='Maden' age={14} />
        <Member name='Tim' lastName='Maden' age={14} />
      </div>
      <Footer />
    </>
  );
}

export default App;
